import React from "react";
import gitimg from '../assets/github.png'
import skill from '../Styles/Skills.css'
const Projects = () =>
{
    return(
        <div>
            <div>P R O J E C T S</div>
            <div className="card">
                <img src={gitimg}/>
                <p>A portfolio website using react js</p>
            </div>
        </div>
    )
}
export default Projects;
